INSERT INTO `COMENTARIO` VALUES (1,'Usuario','Excelente, es un vendedor responsable','2021-08-06 16:33:34',1,2),(2,'Denuncia','La publicidad es engañosa.','2021-08-06 17:07:12',2,6),(3,'Denuncia','Los productos vendidos no son permitidos en el país. ','2021-08-07 04:48:55',2,7),(4,'Denuncia','Hice un depósito a la cuenta pactada, nunca recibí el producto.','2021-08-07 04:50:28',2,12),(5,'Denuncia','El articulo estaba en mal estado','2021-08-07 04:53:28',5,6),(6,'Denuncia','El precio del producto no era acorde a lo recibido.','2021-08-07 04:54:50',5,3),(7,'Denuncia','Es cosa de todos los días: cuando vamos a hacer un trámite a cualquier empresa de servicios o incluso de venta de productos (por ejemplo para cambiar un producto), nos solicitan una autorización con firma certificada, nos piden enviar una carta certificada o documento a algún lugar lejano, acercar fotocopias de una enorme cantidad de documentación y una enorme cantidad de requisitos burocráticos más. Esto se explica por la necesidad de acreditar quién hace el trámite y otros tantos motivos.','2021-08-07 05:10:56',5,10),(8,'Denuncia','PRODUCTOS MAL LOGRADOS.','2021-08-07 05:32:22',63,1),(9,'Denuncia','Vende productos de aparente calidad, pero en realidad no es lo que presenta en el portal.','2021-08-07 05:33:05',63,6),(10,'Denuncia','Tarda en responder, una vez realizado el pago de un producto.','2021-08-07 05:33:40',63,12),(11,'Denuncia','Tardo mucho en enviar el artículo una vez comprado y al recibirlo no era el que había pedido, no existe un orden en su trabajo.','2021-08-07 05:34:18',63,5),(12,'Denuncia','Los productos son realmente caros, y son USADOS.','2021-08-07 05:34:51',63,9),(13,'Denuncia','Sus productos, están en malas condiciones, no lo recomiendo.','2021-08-07 05:41:03',62,12),(14,'Denuncia','Le compre un Protector de Corriente Forza 8 Salidas/ Negro, y el recibido solo era de 6 salidas. Intenté ponerme en contacto y me bloqueo de sus redes sociales.','2021-08-07 05:41:56',62,5),(15,'Denuncia','Hyundai Tablet Koral 7M4 7\" 1GB/ RAM 8GB Negro\NO LO COMPREN, duró un mes y medio, dicho producto tenía una garantía falsa.','2021-08-07 05:42:58',62,10),(16,'Denuncia','Apple iPad Pro 12\" Wi-Fi + Celular 256GB Gris Espacial\nEste producto que ofrece el doctor Anatoly, es una copia china. ','2021-08-07 05:45:30',49,6),(17,'Denuncia','Productos caros. ','2021-08-07 05:45:58',49,1),(18,'Denuncia','Alienware de pésima calidad. \nPagué la totalidad del producto y no es lo que ofrece en la publicación correspondiente.','2021-08-07 15:58:49',33,5),(19,'Denuncia','Otro estafador en esta página, me ha sucedido lo mismo en la compra de los últimos siete productos, vienen en mal estado. ','2021-08-07 16:21:49',33,10);
